import React, { useState, useEffect } from "react";
import { useParams } from "react-router";

const Playlist = (props) => {


  const params = useParams();


  const [data, setData] = useState(null);
  const API_KEY = "?apikey=1d5e6dc7534b9fb3c3421e3448524969";
  const FMP_URL = `https://financialmodelingprep.com/api/v3/profile/`;
  let URL = `${FMP_URL}${params.symbol}${API_KEY}`;
  console.log(URL);

  useEffect(() => {
    let URL = `${FMP_URL}${params.symbol}${API_KEY}`;
    console.log(URL);

    fetch(URL)
      .then((res) => {
        if (res.ok) {
          return res.json();
        }
        throw new Error("Bad Response from Server");
      })
      .then((data) => {
        setData(data[0]);
      })
      .catch((error) => {
        console.log("Error - could not load");
      });
  }, []);

  return data === null ? (
    <h1>LOADING</h1>
  ) : (
    <div>
      {/* <h3>Name: {params.symbol} </h3>
      <h3>Price: {data.price} </h3> */}
    </div>
  );
};

export default Playlist;
